package tencentvectordb_test

import (
	"context"
	"errors"
	"os"
	"strings"
	"testing"

	"github.com/stretchr/testify/require"
	"github.com/tmc/langchaingo/embeddings"
	"github.com/tmc/langchaingo/llms/openai"
	"github.com/tmc/langchaingo/schema"
	"github.com/tmc/langchaingo/vectorstores"
	"github.com/tmc/langchaingo/vectorstores/tencentvectordb"
)

func getValues(t *testing.T) (string, string) {
	t.Helper()

	tencentvectordbAPIKey := os.Getenv("TENCENTVECTORDB_API_KEY")
	if tencentvectordbAPIKey == "" {
		t.Skip("Must set TENCENTVECTORDB_API_KEY to run test")
	}

	tencentvectordbURL := os.Getenv("TENCENTVECTORDB_URL")
	if tencentvectordbURL == "" {
		t.Skip("Must set TENCENTVECTORDB_URL to run test")
	}

	return tencentvectordbAPIKey, tencentvectordbURL
}
func getOpenAIEmbedding(t *testing.T) (embeddings.Embedder, error) {
	t.Helper()
	openaiKey := os.Getenv("OPENAI_API_KEY1")
	if openaiKey == "" {
		t.Logf("OPENAI_API_KEY not set, using mock embedder")
		return NewMockEmbedder(), nil
	}
	apiTypeEnv := os.Getenv("OPENAI_API_TYPE")
	apiType := openai.APITypeOpenAI
	if apiTypeEnv == "azure" {
		apiType = openai.APITypeAzure
	}
	client, err := openai.New(
		openai.WithAPIType(apiType),
		// Azure deployment that uses desired model the name depends on what we define in the Azure deployment section
		openai.WithModel("gpt-35-turbo"),
		// Azure deployment that uses embeddings model, the name depends on what we define in the Azure deployment section
		openai.WithEmbeddingModel("text-embedding-ada-002"),
	)
	require.NoError(t, err)

	e, err := embeddings.NewEmbedder(client, embeddings.WithBatchSize(1), embeddings.WithStripNewLines(false))
	require.NoError(t, err)
	return e, nil
}

func TestTencentvectordb_WithoutEmbedding(t *testing.T) {
	t.Parallel()

	apiKey, host := getValues(t)

	storer, err := tencentvectordb.New(
		tencentvectordb.WithAPIKey(apiKey),
		tencentvectordb.WithUrl(host),
		tencentvectordb.WithCollectionName("test1"),
		tencentvectordb.WithEmbeddingModel("E5_LARGE_V2"),
		tencentvectordb.WithIndexType("HNSW"),
		tencentvectordb.WithMetricType("COSINE"),
	)
	require.NoError(t, err)
	defer storer.DropCollection(context.Background(), "test1")

	_, err = storer.AddDocuments(context.Background(), []schema.Document{
		{PageContent: "Tokyo"},
		{PageContent: "Yokohama"},
		{PageContent: "Osaka"},
		{PageContent: "Nagoya"},
		{PageContent: "Sapporo"},
		{PageContent: "Fukuoka"},
		{PageContent: "Dublin"},
		{PageContent: "Paris"},
		{PageContent: "London "},
		{PageContent: "New York"},
	})
	require.NoError(t, err)

	// test with a score threshold of 0.8, expected first document to be Tokyo
	docs, err := storer.SimilaritySearch(context.Background(),
		"Which of these are cities in Japan", 10,
		vectorstores.WithScoreThreshold(0.8))
	require.NoError(t, err)
	for _, doc := range docs {
		t.Logf("doc: %#+v", doc)
	}
	require.Equal(t, "Tokyo", docs[0].PageContent)

	// test with a score threshold of 0, expected all 10 documents
	docs, err = storer.SimilaritySearch(context.Background(),
		"Which of these are cities in Japan", 10,
		vectorstores.WithScoreThreshold(0))
	require.NoError(t, err)
	require.Len(t, docs, 10)
}

func TestTencentvectordb_WithEmbedding(t *testing.T) {
	t.Parallel()

	getValues(t)
	e, _ := getOpenAIEmbedding(t)
	storer, err := tencentvectordb.New(
		//tencentvectordb.WithAPIKey(apiKey), //read from env
		//tencentvectordb.WithUrl(host),
		tencentvectordb.WithDatabase("openaiEmbeddingDb"),
		tencentvectordb.WithEmbedder(e),
		tencentvectordb.WithDimension(1536),
		tencentvectordb.WithCollectionName("test2"),
	)
	defer storer.DropCollection(context.Background(), "test2")
	require.NoError(t, err)

	_, err = storer.AddDocuments(context.Background(), []schema.Document{
		{PageContent: "Tokyo"},
		{PageContent: "Yokohama"},
		{PageContent: "Osaka"},
		{PageContent: "Nagoya"},
		{PageContent: "Sapporo"},
		{PageContent: "Fukuoka"},
		{PageContent: "Dublin"},
		{PageContent: "Paris"},
		{PageContent: "London "},
		{PageContent: "New York"},
	})
	require.NoError(t, err)

	docs, err := storer.SimilaritySearch(context.Background(),
		"Which of these are cities in Japan", 10,
		vectorstores.WithScoreThreshold(0.8),
	)
	require.NoError(t, err)
	// test with a score threshold of 0.8, expected 6 documents
	require.Len(t, docs, 6)
	require.Equal(t, "Tokyo", docs[0].PageContent)

	docs, err = storer.SimilaritySearch(context.Background(),
		"Which of these are cities in Japan", 8)
	require.NoError(t, err)
	require.Len(t, docs, 8)
}

